import { DensityMedium, KeyboardArrowDown, Search } from '@mui/icons-material';
import React from 'react';
import styled from 'styled-components';

const Container = styled.div`
  display: flex;
  background-color: white;
  padding: 15px 20px;
`;
const Left = styled.div`
  flex: 1;
  display: flex;
  align-items: center;
  justify-content: center;
`;
const Logo = styled.h1`
  font-size: 25px;
  font-weight: 800;
  color: #bd1a1a;
  :hover {
    cursor: pointer;
  }
`;
const Center = styled.div`
  flex: 2;
  display: flex;
  align-items: center;
  justify-content: center;
`;
const SearchContainer = styled.div`
  width: 70%;
  border: 0.5px solid lightgray;
  display: flex;
  align-items: center;
  margin-left: 5px;
  padding: 5px;
  border-radius: 10px;
`;
const Input = styled.input`
  width: 100%;
  font-size: 20px;
  border: none;
  pa: 5px 10px;
  &:focus {
    outline: none;
  }
`;
const Button = styled.button`
  padding: 0px 18px;
  border-radius: 10px;
  border: none;
  background-color: #bd1a1a;
  color: white;
  :hover {
    cursor: pointer;
  }
`;
const Right = styled.div`
  flex: 1;
`;
const MenuItem = styled.div``;
const Navbar = () => {
  return (
    <Container>
      <Left>
        <Logo>BOOKSTORE</Logo>
      </Left>
      <Center>
        <DensityMedium style={{ color: 'darkgray' }} />
        <KeyboardArrowDown style={{ color: 'darkgray' }} />
        <SearchContainer>
          <Input />
          <Button>
            <Search />
          </Button>
        </SearchContainer>
      </Center>
      <Right></Right>
    </Container>
  );
};

export default Navbar;
